issues.body:
`any`, `all` operations can be implemented on aarch64 with single instruction `vminvq`, `vmaxvq`.
Currently, xsimd uses `vpmin`, `vpmax`, it's low efficient.
E.g., below code can be significantly simplified on aarch64.
**current code**
```
template <class A, class T, detail::enable_sized_t<T, 1> = 0>
bool all(batch_bool<T, A> const& arg, requires_arch<neon>)
{
        uint8x8_t tmp = vand_u8(vget_low_u8(arg), vget_high_u8(arg));
        tmp = vpmin_u8(tmp, tmp);
        tmp = vpmin_u8(tmp, tmp);
        tmp = vpmin_u8(tmp, tmp);
        return vget_lane_u8(tmp, 0);
}
```
**refined for aarch64**
```
template <class A, class T, detail::enable_sized_t<T, 1> = 0>
bool all(batch_bool<T, A> const& arg, requires_arch<neon>)
{
        return vminvq_u8(arg);
}
```
